import Header from '../components/header'
import Pups from '../components/index-sections/pups'
import Footer from '../components/footer'

const Puppies = () => {
    return (
        <div>
            <Header/>
            <Pups />
            <Footer/>
        </div>
    )
}

export default Puppies
